import React from "react";
import { Field } from "formik";
import { Box, Button, Grid, TextField } from "@material-ui/core";
import { useStyles } from "../hooks/Styles";

function From1({formik}) {
    const classes = useStyles();
  return (
    <div style={{ marginTop: "50px" }}>
      <Grid container justify="space-between">
        <Field
          variant="outlined"
          required
          name="nom"
          label="Nom"
          type="text"
          id="nom"
          className={classes.formText}
          // onChange={(e) => setNom(e.target.value)}
          // value={nom}
          // onFocus={FocusItem}
          as={TextField}
          error={formik.errors.nom &&  formik.touched.nom ? true : false}
        />
        <Field
          variant="outlined"
          required
          name="prenom"
          label="Prénom"
          type="text"
          id="prenom"
          className={classes.formText}
          // onChange={(e) => setPrenom(e.target.value)}
          // value={prenom}
          as={TextField}
          error={formik.errors.prenom &&  formik.touched.prenom ? true : false}

        />
      </Grid>
      <Field
        variant="outlined"
        margin="normal"
        required
        fullWidth
        id="email"
        label="Email"
        type="email"
        name="email"
        //   onChange={(e) => setEmail(e.target.value)}
        //   value={email}
        as={TextField}
        error={formik.errors.email &&  formik.touched.email ? true : false}

      />
      <Field
        variant="outlined"
        margin="normal"
        required
        fullWidth
        id="phone"
        label="Téléphone"
        type="tel"
        name="phone"
        //   onChange={(e) => setPhone(e.target.value)}
        //   value={phone}
        as={TextField}
        error={formik.errors.phone &&  formik.touched.phone ? true : false}

      />
      {/* {alertMail ? <Alert severity="error">{alertMail}</Alert> : <></>} */}
      <Field
        variant="outlined"
        margin="normal"
        required
        fullWidth
        type="password"
        name="password"
        id="password"
        label="Mot de passe"
        //   onChange={(e) => setPassword1(e.target.value)}
        //   value={password1}
        as={TextField}
        error={formik.errors.password &&  formik.touched.password ? true : false}

      />
      <Field
        variant="outlined"
        margin="normal"
        required
        fullWidth
        type="password"
        name="cfpassword"
        id="cfpassword"
        label="Valider le mot de passe"
        //   onChange={(e) => setPassword2(e.target.value)}
        //   value={password2}
        as={TextField}
        error={formik.errors.cfpassword &&  formik.touched.cfpassword ? true : false}

      />
      {/* {alert ? <Alert severity="error">{alert}</Alert> : <></>} */}

      <Box mt={10} style={{ width: "93%" }}>
        <Grid container spacing={10} justify="flex-end" mr={15}>
          <Button
            // onClick={(e) => handleSubmit(e)}
            variant="contained"
            style={{ backgroundColor: colors.brown }}
            className={classes.btn}
          >
            Suivant &gt;
          </Button>
        </Grid>
      </Box>
    </div>
  );
}

export default From1;
